// Solution 2:
const moveElementToEnd = (array, toMove) => {
    for (let i = 0; i < array.length; i++) {
        if (array[i] === toMove) {
            for (let j = array.length - 1; j > i; j--) {
                if (array[j]!== toMove) {
                    [array[i], array[j]] = [array[j], array[i]];
                    break;
                }
            }
        }
    }

    return array;
};

console.log(moveElementToEnd(['d', 'd', 'd', 'd', 'a', 'a', 'a', 'a', 'a', 'a', 'a', 'a'], 'd')); // ['a', 'a', 'a', 'd', 'd', 'd', 'd', 'a', 'a', 'a', 'a', 'a']
